<p>Here is some code:</p>

<p>db.js:</p>

<pre><code>const mongoose = require('mongoose');

//mongoose setup
mongoose.connect(mongooseUrl, { useNewUrlParser: true });
var db = mongoose.connection;
db.on('error', console.error.bind(console, 'connection error:'));
db.once('open', function() {
  console.log('mongoose connected to ' + mongooseUrl);
});

module.exports = db;
</code></pre>

<p>app.js: </p>

<pre><code>var createError = require('http-errors');
var express = require('express');
var path = require('path');
var cookieParser = require('cookie-parser');
var logger = require('morgan');

// import routers
var indexRouter = require('./routes/index');
var usersRouter = require('./routes/users');
var apiRouter = require('./routes/api');


var app = express();

// view engine setup
app.set('views', path.join(__dirname, 'views'));
app.set('view engine', 'hbs');

app.use(logger('dev'));
app.use(express.json());
app.use(express.urlencoded({ extended: false }));
app.use(cookieParser());
app.use(express.static(path.join(__dirname, 'public')));

app.use('/', indexRouter);
app.use('/users', usersRouter);
app.use('/api', apiRouter);

// catch 404 and forward to error handler
app.use(function(req, res, next) {
  next(createError(404));
});

// error handler
app.use(function(err, req, res, next) {
  // set locals, only providing error in development
  res.locals.message = err.message;
  res.locals.error = req.app.get('env') === 'development' ? err : {};

  // render the error page
  res.status(err.status || 500);
  res.render('error');
});

module.exports = app;
</code></pre>

<p>/routes/api.js: </p>

<pre><code>var express = require('express');
var mongoose = require('mongoose');
var db = require('../config/db.js');
var Kitten = require('../models/kitten.js');

var router = express.Router();

/* GET home page. */
router.get('/', function(req, res, next) {
  res.render('api', { 
    title: 'Test API',
    content: 'you\'re in the right place',
    buttontext: 'send POST request'
  });
});

router.post('/newKitten', function(req, res, next) {
    var kitty = new Kitten({
        name: req.body.name,
        color: req.body.color
    });
    console.log("new kitty: " + kitty.name + " color: " + kitty.color );
    kitty.save().then(console.log(kitty + " was saved to the database"));
    res.send('new: ' + kitty);

});

router.get('/kittens', function (req, res, next)  {
    var kittens = Kitten.find({}, 'name color');
    res.render('kittens', {title: 'Kittens', list_kittens: kittens });
});

module.exports = router;
</code></pre>

<p>models/kitten.js</p>

<pre><code>const mongoose = require('mongoose');

var Schema = mongoose.Schema;

var kittenSchema = new Schema({
    name: String,
    color: String
});

var Kitten = mongoose.model("Kitten", kittenSchema);


module.exports = Kitten;
</code></pre>

<p>views/kitten.hbs:</p>

<pre><code>&lt;h1&gt;{{title}}&lt;/h1&gt;

&lt;ul&gt;
    {{#each list_kittens as |kitten|}}
        &lt;li&gt;name: {{kitten.name}}, color: {{kitten.color}}&lt;/li&gt;
    {{/each}}
&lt;/ul&gt;
</code></pre>

<p>Now with all that laid out, when I visit <a href="http://localhost:3000/api/kittens" rel="nofollow noreferrer">http://localhost:3000/api/kittens</a> this is what I see:
<a href="https://i.stack.imgur.com/gU1sP.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/gU1sP.png" alt="enter image description here"></a></p>

<p>The kittens are stored in MongoDB, proof: 
<a href="https://i.stack.imgur.com/YnzVE.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/YnzVE.png" alt="enter image description here"></a></p>

<p>I have no idea why this is not rendering the kittens I have saved in my MongoDB database... The data is there, but I seem to be confused about how mongoose is supposed to be querying the data. Any and all help is appreciated. I've been stuck on this for a few days.</p>

