Pymongo find value in subdocuments<p>I'm using MongoDB 4 and Python 3. I have 3 collections. The first collection got 2 referenced fields on the other collections. </p>

<p><strong>Example :</strong></p>

<pre><code>User {
   _id  : ObjectId("5b866e8e06a77b30ce272ba6"),
   name : "John",
   pet  : ObjectId("5b9248cc06a77b09a496bad0"),
   car  : ObjectId("5b214c044ds32f6bad7d2"),
}

Pet {
   _id  : ObjectId("5b9248cc06a77b09a496bad0"),
   name : "Mickey",
}

Car {
   _id   : ObjectId("5b214c044ds32f6bad7d2"),
   model : "Tesla"
}
</code></pre>

<p>So one User has one car and one pet. I need to query the User collection and find if there is a User who has a Pet with the name "Mickey" and a Car with the model "Tesla".</p>

<p>I tried this :</p>

<pre><code>db.user.aggregate([{
    $project : {"pet.name" : "Mickey", "car.model" : "Tesla"  } 
}])
</code></pre>

<p>But it returns me lot of data while I have just one document with this data. What I'm doing wrong ?</p>

