Duplicate Key Error on MongoDB Model, Even When Model is Not Enforcing Uniqueness for that Value<p>In my app I have an endpoint that allows a user to create a new document by simply passing something like this:</p>

<pre><code>{ name: { long: "some name" } }
</code></pre>

<p>Now, the relevant portion of the model for this document looks like this:</p>

<pre><code>name: {
  long: {
    type: String,
    trim: true
  },
  short: {
    type: String,
    trim: true
  }
}
</code></pre>

<p>As you can see, I don't have "short" set to "unique: true". However, the user is getting this error:</p>

<pre><code> "errmsg": "E11000 duplicate key error collection: hr.agencies index: name.short_1 dup key: { : null }"
</code></pre>

<p>So, clearly the problem here is that once you have more than one "name.short" with a value of <code>null</code>, its producing a dupe error. However, since I don't have <code>unique</code> set to <code>true</code> in the model, I'm not sure why it's enforcing this as a rule.</p>

<p>What could the issue be here, and how can I resolve it? Is there a way I can explicitly say, don't enforce uniqueness on this field?</p>

